import "./App.css";
import Youtube from "./component/youtube/Youtube";
import { YoutubeData } from "./Youtube-data";

function App() {
    return (
        <div className="youtube-list">
            {YoutubeData.map((item, index) => (
                <Youtube
                    key={item.id}
                    image={item.image}
                    avatar={item.avatar || item.image}
                    title={item.title}
                    author={item.author}
                ></Youtube>
            ))}
        </div>
    );
}

export default App;
